impl Solution {
    pub fn account_balance_after_purchase(purchase_amount: i32) -> i32 {
        let initial_balance = 100;
        let remainder = purchase_amount % 10;
        let rounded_purchase_amount = if remainder < 5 {
            purchase_amount - remainder
        } else {
            purchase_amount + (10 - remainder)
        };
        initial_balance - rounded_purchase_amount
    }
}
